package com.brink.model;import java.time.LocalDateTime;public class ProjectSummary {    private String projectName;    private LocalDateTime createdDate;    public String getProjectName() {        return projectName;    }    public void setProjectName(String projectName) {        this.projectName = projectName;    }    public LocalDateTime getCreatedDate() {        return createdDate;    }    public void setCreatedDate(LocalDateTime createdDate) {        this.createdDate = createdDate;    }}